import React, { useEffect, useState} from "react";



function OrganizerDrafts(){
    const [drafts, setDrafts] = useState([])


    useEffect(() => {
        fetch(1/organizers)
        .then((res) => res.json())
        .then((data) => setDrafts(data))
    }, [])

    console.log(drafts);




    return(
        <div>
       <h1>Drafts</h1>

        </div>
    )
}
export default OrganizerDrafts;
